if mibBuilder.loadTexts: recfBundleDeviceType.setDescription('Parameter Type = Non-intrusive. This field indicates the type of device connected to the port. Values 1-10 and 255 are reserved by ST-50, of which 1 is for voice, 2 is for switch 56, 3 is for clear channel, and 255 is for INL. Values 11 to 254 can be used by the user to define user-specific device types. For TDM channels connected between I/O ports, the channel will not connect if the device types do not match. For I/O to server port connections, the device types will not be compared. This field is not used by the ST node if recfBundleType is null or inl. Note that if the recfBundleType is inl but this field is not 255, the inl will not be failed. Also, if the recfBundleType is not inl but this field is 255, then the channel defined on this port will still be able to connect.')
recfBundleContentionSet = MibTableColumn((1, 3, 6, 1, 4, 1, 16, 101, 1, 2, 1, 7, 1, 20), Integer32().subtype(subtypeSpec=ConstraintsUnion(SingleValueConstraint(1, 3, 4, 5, 6, 2))).clone(namedValues=NamedValues(("em", 1), ("signalInvert", 3), ("fxo", 4), ("fxs-ard", 5), ("fxs", 6), ("disable", 2))).clone('em')).setMaxAccess("readwrite")
