if mibBuilder.loadTexts: recfBundleSigInversion.setDescription('Parameter Type = Intrusive. INTRODUCED 2.0.0 For an E1M bundle, the meanings of these values are reversed. That is, if this parameter is set as normal, the ABCD signal polarity will be inverted on the ST bus. If it is set as inverted, the ABCD signal polarity will NOT be inverted on the ST bus. Contention channel connect/disconnect will be affected by this filed: a) For a T1M bundle set as normal or an E1M bundle set as inverted: If recfBundleContentionSet is set as E&M: Connections are initiated when the incoming A bit is set to 1. Disconnections are triggered when the incoming A bit is set to 0. If recfBundleContentionSet is set as FXS: Connections are initiated when the incoming A bit is set to 1. Disconnections are triggered when the incoming A bit is set to 0. If recfBundleContentionSet is set as FXO: Connections are initiated when the incoming B bit is set to 0. Before FXS answers the call, disconnections will be triggered when the B bit is set to 1. If recfBundleContentionSet is set as FXS-ARD: Connections are initiated when the incoming A bit is set to 0. Disconnections are triggered when the incoming A bit is a 1. b) For a T1M bundle set as inverted or an E1M bundle set as normal: If recfBundleContentionSet is set as E&M: Connections are initiated when the incoming A bit is set to 0. Disconnections are triggered when the incoming A bit is set to 1. If recfBundleContentionSet is set as FXS: Connections are initiated when the incoming A bit is set to 0. Disconnections are triggered when the incoming A bit is set to 1. If recfBundleContentionSet is set as FXO: Connections are initiated when the incoming B bit is set to 1. Before FXS answers the call, disconnections will be triggered when the B bit is set to 0. If recfBundleContentionSet is set as FXS-ARD: Connections are initiated when the incoming A bit is set to 1. Disconnections are triggered when the incoming A bit is set to 0.')
